import React from "react";

import { Typography, Box, Input } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

import * as Yup from "yup";
import { Formik } from "formik";

const styles = makeStyles({
  wrapper: {
    backgroundColor: "#E9ECEF",
    height: "100vh",
    paddingTop: "3rem",

    display: "flex",
    flexDirection: "column",
    justifyContent: "flex-start",
    alignItems: "center",
  },
  inputWrapper: {
    marginBottom: "1rem",
  },
  inputStyle: {
    backgroundColor: "#ffffff",
  },
});

const index = () => {
  const { wrapper, inputWrapper, inputStyle } = styles();
  return (
    <Box className={wrapper}>
      <Box className={inputWrapper}>
        <Typography> First Name</Typography>
        <Box className={inputStyle}>
          <Input type="email" placeholder="Enter your first name " />
        </Box>
      </Box>

      <Box>
        <Typography> Name</Typography>
        <Box className={inputStyle}>
          <Input
            type="email"
            disableUnderline={true}
            placeholder="Enter your vfirst name "
          />
        </Box>  
      </Box>

      <Box>
        <Typography> First Name</Typography>
        <Input
          style={{ backgroundColor: "#ffffff" }}
          type="email"
          placeholder="Enter your vfirst name "
        />
      </Box>

      <Box>
        <Typography> First Name</Typography>
        <Input
          style={{ backgroundColor: "#ffffff" }}
          type="email"
          placeholder="Enter your vfirst name "
        />
      </Box>

      <Box>
        <Typography>Last Name</Typography>
        <Input
          style={{ backgroundColor: "#ffffff" }}
          type="email"
          placeholder="Enter your last name "
        />
      </Box>

      <style jsx global>{`
        body {
          margin: 0px;
        }
      `}</style>
    </Box>
  );
};
export default index;
